/* eslint no-unused-vars: 0 */
import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<${scopeTag("ui5-responsive-popover", tags, suffix)} hide-arrow content-only-on-desktop placement-type="Bottom" horizontal-align="Left" with-padding _hide-header @keydown="${context._onkeydown}"><${scopeTag("ui5-list", tags, suffix)} mode="SingleSelectAuto" separators="None" @ui5-item-press="${ifDefined(context._onOverflowListItemSelect)}">${ repeat(context._overflowItemsData, (item, index) => item._id || index, (item, index) => block1(item, index, context)) }</${scopeTag("ui5-list", tags, suffix)}><div slot="footer" class="ui5-breadcrumbs-popover-footer"><${scopeTag("ui5-button", tags, suffix)} design="Transparent" @click="${context._closeRespPopover}">${ifDefined(context._cancelButtonText)}</${scopeTag("ui5-button", tags, suffix)}></div></${scopeTag("ui5-responsive-popover", tags, suffix)}>`; };
const block1 = (item, index, context) => { return html`<${scopeTag("ui5-li", tags, suffix)} id="${ifDefined(item._id)}-li" accessible-name="${ifDefined(item.accessibleName)}" data-ui5-stable="${ifDefined(item.stableDomRef)}">${ifDefined(item.textContent)}</${scopeTag("ui5-li", tags, suffix)}>`; };


	return block0(context);
};

export default main;
